            localStorage.setItem("loggedIn", false)
        }
    })
    return (
        <div className="Home">
            <div className="Post">
                <div className="Image">
                    <Image cloudName="dlhqyhr1r" publicId="iubggoqohnktyrqqpymr"
                    />
                </div>
                <div className="Content">
                </div>
            </div>
        </div>
    )
}

export default Home
